export const searchBarVariant = {
  initial: { opacity: 0, y: "10%" },
  animate: {
    opacity: 1,
    y: 0,
    transition: {
      opacity: {
        delay: 0.1,
      },
      type: "tween",
      duration: 0.2,
      ease: "easeInOut",
    },
  },
  exit: { opacity: 0, y: "20%" },
};
